import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';
import ScrollToTop from '../ScrollToTop';

function Home() {
  return (
    <>
      <HeroSection />
      <Cards />
      <Footer />
      <ScrollToTop/>

    </>
  );
}

export default Home;
